* {margin: 0; padding: 0;}
li {list-style: none;}
a {color: black; text-decoration: none;}
img {display: block;}

* {font-family: 'Spoqa Han Sans Neo', 'Spoqa Han Sans JP', sans-serif;}

html, body {
    font-size: 62.5%;
}

@media all and (min-width:320px) and (max-width:600px) {

    body {font-size: 1.4rem;}

    .outer_header .inner_header .header .gnb,
    .outer_header .inner_header .header .search_text_box {display: none;}

    .outer_header {
        width: 100%;
        height: 45px;
        background-color: white;
    }
    .outer_header .inner_header {
        width: 100%;
    }
    .outer_header .inner_header .header {
        width: 100%;
        line-height: 45px;
    }
    .outer_header .inner_header .header .header_box {
        width: 100%;
        height: 45px;
        position: relative;
    }
    .outer_header .inner_header .header .logo {
        width: 165px;
        height: 45px;
    }
    .outer_header .inner_header .header .logo img {
        width: 100%;
        height: 36px;
        padding-top: 4px;
    }
    .outer_header .inner_header .header .mob_gnb {
        width: 80px;
        height: 45px;
        position: absolute;
        top: 0;
        right: 30px;
        display: flex;
    }
    .outer_header .inner_header .header .mob_gnb>span {
        height: 45px;
        padding: 0 4px;
    }
    .outer_header .inner_header .header .mob_gnb>span>a {
        font-size: 1.7rem;
    }
    .outer_header .inner_header .header .mob_gnb>span:last-child>a img {
        width: 16px;
        height: 16px;
        padding-top: 14px;
        padding-left: 1px;
    }
    .outer_header .inner_header .header .mob_bar {
        width: 30px;
        height: 45px;
        position: absolute;
        top: 0;
        right: 0;
        font-size: 1.7rem;
    }

    .outer_header .inner_header .header .hide_sub {
        width: 80%;
        height: 100vh;
        background-color: white;
        position: relative;
        position: fixed;
        top: 0;
        right: -100%;
        transition: all 0.5s;

        z-index: 3;
    }
    .outer_header .inner_header .header .hide_sub.active {
        right: 0;
    }
    .outer_header .inner_header .header .hide_sub .sub {
        display: flex;
        flex-wrap: wrap;
        width: 100%;
        border-bottom: 1px solid #eee;
        box-sizing: border-box;
    }
    .outer_header .inner_header .header .hide_sub .sub_box {
        width: 100%;
        height: 45px;
    }
    .outer_header .inner_header .header .hide_sub .sub_box .sub_logo {
        width: 165px;
        height: 45px;
    }
    .outer_header .inner_header .header .hide_sub .sub_box .sub_logo img {
        width: 100%;
        height: 36px;
        padding-top: 4px;
    }
    .outer_header .inner_header .header .hide_sub .sub_box .sub_close_btn {
        position: absolute;
        top: 0px;
        right: 16px;
        font-size: 1.9rem;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb {
        display: flex;
        width: 100%;
        height: 40px;
        border-top: 1px solid #eee;
        border-bottom: 1px solid #eee;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb>div {
        width: 25%;
        height: 40px;
        line-height: 40px;
        text-align: center;
        border-left: 1px solid #eee;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb>div:first-child {
        border-left: none;
    }
    .outer_header .inner_header .header .hide_sub .sub_gnb>div:nth-child(2) {
        width: 25.5%;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box {
        display: flex;
        width: 100%;
        height: 40px;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box>div {
        width: 50%;
        height: 40px;
        line-height: 40px;
        text-align: center;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box>div:first-child {
        border-right: 1px solid #eee;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box .sub_sns {
        font-size: 1.7rem;
    }
    .outer_header .inner_header .header .hide_sub .sub_icon_box .sub_sns>span:nth-child(2) {
        padding: 0 15px;
    }

    .outer_header .inner_header .header .hide_sub .lnb>li {
        width: 100%;
        position: relative;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>a {
        display: block;
        width: 100%;
        height: 40px;
        line-height: 40px;
        background-color: white;
        padding-left: 15px;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>a>i {
        position: absolute;
        top: 10px;
        right: 15px;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>ul {
        display: none;
    }
    .outer_header .inner_header .header .hide_sub .lnb>li>ul>li>a {
        display: block;
        width: 100%;
        height: 40px;
        line-height: 40px;
        background-color: #eee;
        padding-left: 15px;
        font-size: 1.2rem;
    }
    .outer_header .inner_header .header .lnb>li>ul>li>a>span i {
        padding-left: 3px;
        color: rgb(255, 48, 117);
    }
    .outer_header .inner_header .header .hide_back {
        display: none;
        width: 100%;
        height: 100vh;
        background-color: rgba(0, 0, 0, 0.7);

        position: fixed;
        top: 0;

        z-index: 2;
    }




    .route_box {
        width: 100%;
        height: 40px;
        line-height: 40px;
        z-index: 2;
        background-color: white;
    }
    .fix {
        position: fixed;
        top: 0;
    }
    .route_box .route {margin: 0 15px;}
    .route_box .route>i {
        padding: 0 15px;
    }
    .route_box .route select {
        width: 20%;
        height: 35px;
        line-height: 35px;
        text-align: center;
        border: none;
        background-color: none;
        padding: 0 5px;
        font-size: 1.4rem;
    }

    .backimg {
        width: 100%;
        height: 750px;
        background-image: url(./images/visual_main/origin_600x750_mobile.jpg);
        background-repeat: no-repeat;
        position: fixed;
        top: 0;

        z-index: -1;
    }

    .wrap {
        width: 100%;
        height: auto;
    }
    .wrap .title {
        width: 100%;
        height: 750px;
        background-color: none;
        margin: auto;
        text-align: center;
        color: white;
    }
    .wrap .title>p:first-child {
        padding-top: 20%;
        font-size: 5.5rem;
    }
    .wrap .title>p:nth-child(2) {
        font-size: 1.6rem;
        margin-bottom: 10px;
    }

    .wrap .history_txt {
        width: 100%;
        height: 750px;
        background-image: linear-gradient(to top, white, rgba(0,0,0,0));
        font-size: 1.2rem;
    }
    .wrap .history_txt>div {
        padding: 0 15px;
    }
    .wrap .history_txt>div>p:first-child {
        margin-bottom: 15px;
        text-align: center;
    }
    .wrap .history_txt>div>p:nth-child(2) {
        padding-bottom: 15px;
        border-bottom: 2px solid black;
        box-sizing: border-box;
        text-align: center;
    }
    .wrap .history_txt>div>div {
        width: 10%;
        padding: 20px 0;
        margin: auto;
    }
    .wrap .history_txt>div>div>img {
        width: 100%;
    }

    .wrap .tab_link {
        display: flex;
        width: 100%;
        height: 40px;
        line-height: 40px;
        background-color: #eee;
    }
    .wrap .tab_link>a {
        display: block;
        width: 45%;
        height: 40px;
        text-align: center;
    }
    .fix02 {
        position: fixed;
        top: 40px;
    }

    .wrap .history {
        background-color: white;
    }
    .wrap .history_title {
        width: 100%;
        height: 40px;
        line-height: 40px;
        text-align: center;
        padding: 20px 0;
        background-color: white;
    }
    .wrap .history .con_2022,
    .wrap .history .con_2021,
    .wrap .history .con_2020,
    .wrap .history .con_2019,
    .wrap .history .con_2018,
    .wrap .history .con_2017,
    .wrap .history .con_2016,
    .wrap .history .con_2015,
    .wrap .history .con_2014,
    .wrap .history .con_2013,
    .wrap .history .con_2012,
    .wrap .history .con_2011,
    .wrap .history .con_2008 {
        width: 100%;
        height: auto;
        margin: 15px 0;
        padding-bottom: 20px;
        border-bottom: 1px solid #ccc;
        box-sizing: border-box;
    }
    .wrap .history .con_2022 {
        margin-top: 0;
    }
    .wrap .history .con_2020 {
        padding-bottom: 40px;
    }
    .wrap .history .con_2008 {
        margin-bottom: 0;
    }

    .wrap .history .con_2022>div,
    .wrap .history .con_2021>div,
    .wrap .history .con_2020>div,
    .wrap .history .con_2019>div,
    .wrap .history .con_2018>div,
    .wrap .history .con_2017>div,
    .wrap .history .con_2016>div,
    .wrap .history .con_2015>div,
    .wrap .history .con_2014>div,
    .wrap .history .con_2013>div,
    .wrap .history .con_2012>div,
    .wrap .history .con_2011>div,
    .wrap .history .con_2008>div {
        width: 100%;
    }

    .wrap .history .con_2011>div>p:last-child {
        padding-bottom: 20px;
    }


    .wrap .history>div>div>p:first-child {
        height: 40px;
        line-height: 40px;
        text-align: center;
        border-bottom: 1px dotted #ccc;
        box-sizing: border-box;
        background-color: white;
        margin: auto;
    }
    .wrap .history>div>div>p:nth-child(2) {
        padding-top: 15px;
    }
    .wrap .history>div>div>p {
        padding: 0 15px;
        font-size: 1.2rem;
    }
    .wrap .history>div>div>p>span>img {
        display: inline-block;
        height: 30px;
        line-height: 30px;
        padding-right: 5px;
    }
    .wrap .history .txt_wrap {
        display: block;
        height: 30px;
        line-height: 30px;
        padding-left: 37px;
    }

    .wrap .history .con_2021 {
        background-image: url(./images/history/history01_600x340_op20_mobile.jpg);
        background-size: cover;
    }
    .wrap .history .con_2018 {
        background-image: url(./images/history/history02_600x412_op20_mobile.jpg);
        background-size: cover;
    }
    .wrap .history .con_2012 {
        background-image: url(./images/history/history03_600x309_op20_mobile.jpg);
        background-size: cover;
    }

    .wrap .history .con_img01 img,
    .wrap .history .con_img02 img,
    .wrap .history .con_img03 img {
        display: none;
    }
    .wrap .tab_link02 {
        display: none;
    }
    



    #chk_info {display: none;}
    #chk_info:checked ~ .info {display: flex;}
    #chk_info:checked ~ .chk_info i {transition: all 0.4s; transform: rotate(180deg);}
    #chk_info ~ .info {display: none;}
    
    .service_box {
        padding-top: 50px;
        display: flex;
        flex-wrap: wrap;
        background-color: white;
    }
    .service_box>section {
        width: 100%;
    }
    .service_box label {
        width: 100%;
        display: flex;
        height: 40px;
        line-height: 40px;
        position: relative;
        padding-left: 15px;
        background-color: #eee;
    }
    .service_box label i {
        position: absolute;
        top: 10px;
        right: 15px;
        font-size: 2rem;
    }
    .service_box .info {
        display: flex;
        height: auto;
        background-color: #ccc;
    }
    .service_box .info ul {
        width: 50%;
        margin: 15px 15px;
    }
    .service_box .info ul li {
        height: 25px;
        line-height: 25px;
    }



    .agency {
        display: flex;
        flex-wrap: wrap;
        border-top: 1px solid #ccc;
        border-bottom: 1px solid #ccc;
    }
    .agency>div {
        width: 100%;
    }
    .agency>div:last-child {
        border-top: 1px solid #ccc;
    }

    .agency .relevant_box {
        display: flex;
        height: 40px;
        position: relative;
    }
    .agency .relevant_box>p {
        width: 40%;
        height: 40px;
        line-height: 40px;
        padding-left: 15px;
    }
    .agency .relevant_box>p i {
        font-size: 1rem;
        border: 1px solid #ccc;
        box-sizing: border-box;
        padding: 3px;
        margin-left: 3px;
    }
    .agency .relevant_box .relevant {
        width: 60%;
        height: 40px;
        position: relative;
        overflow: hidden;
    }
    .agency .relevant_box .relevant>ul {
        display: flex;
        width: 1000%;
        height: 40px;
        position: absolute;
        top: 0;
        left: 0;
    }
    .agency .relevant_box .relevant>ul>li {
        display: flex;
        justify-content: center;
        width: 100%;
        height: 40px;
        font-size: 20px;
        box-sizing: border-box;
    }
    .agency .relevant_box .relevant>ul>li>div>a {
        display: block;
        width: 100%;
        height: 40px;
    }
    .agency .relevant_box .relevant>ul>li>div>a>img {
        width: 100%;
        height: 38px;
        padding-top: 1px;
    }



    .agency .mesena_box {
        display: flex;
        height: 40px;
        position: relative;
    }
    .agency .mesena_box>p {
        width: 40%;
        height: 40px;
        line-height: 40px;
        padding-left: 15px;
    }
    .agency .mesena_box>p i {
        font-size: 1rem;
        border: 1px solid #ccc;
        box-sizing: border-box;
        padding: 3px;
        margin-left: 3px;
    }
    .agency .mesena_box .mesena {
        width: 60%;
        height: 40px;
        position: relative;
        overflow: hidden;
    }
    .agency .mesena_box .mesena>ul {
        display: flex;
        width: 200%;
        height: 40px;
        position: absolute;
        top: 0;
        left: 0;
    }
    .agency .mesena_box .mesena>ul>li {
        display: flex;
        justify-content: center;
        width: 100%;
        height: 40px;
        font-size: 2rem;
    }
    .agency .mesena_box .mesena>ul>li>div:first-child {
        width: 80%;
        height: 40px;
    }
    .agency .mesena_box .mesena>ul>li>div:last-child {
        width: 80%;
        height: 40px;
    }
    .agency .mesena_box .mesena>ul>li>div>a {
        display: block;
        width: 100%;
        height: 40px;
    }
    .agency .mesena_box .mesena>ul>li>div>a>img {
        width: 100%;
        height: 38px;
        padding-top: 1px;
    }



    .letter {
        display: flex;
        order: -1;
        position: relative;
        border-top: 1px solid #ccc;
        border-bottom: 1px solid #ccc;
        background-color: white;
    }
    .letter p {
        height: 40px;
        line-height: 40px;
        padding-left: 15px;
    }
    .letter a {
        display: block;
        width: 100px;
        height: 30px;
        line-height: 30px;
        text-align: center;
        color: white;
        background-color: #2e3192;
        border-radius: 25px;
        margin-top: 5px;
        position: absolute;
        right: 10px;
    }




    .footer {
        display: flex;
        flex-wrap: wrap;
        height: auto;
        padding: 15px 15px;
        background-color: #eee;
    }
    .footer>div>div:first-child {
        font-size: 1.1rem;
        color: #666;
        padding: 15px 0;
    }
    .footer>div>div:first-child>p {
        height: 25px;
        line-height: 25px;
    }
    .footer>div>div:first-child>p:first-child {
        height: 50px;
    }
    .footer>div>div:first-child>p:first-child>span:first-child {
        display: block;
        height: 25px;
        line-height: 25px;
    }
    .footer>div>div:first-child>p:nth-child(3) {
        height: 50px;
    }
    .footer>div>div:first-child>p:nth-child(3)>span {
        display: block;
        height: 25px;
        line-height: 25px;
    }
    .footer>div>div:first-child>p:nth-child(3)>span>a {
        display: inline-block;
        padding: 0 6px;
        border: 1px solid #ccc;
        box-sizing: border-box;
        background-color: white;
        border-radius: 5px;
        font-size: 1.1rem;
    }
    .footer>div>div:last-child {
        width: 100%;
        display: flex;
    }
    .footer>div>div:last-child>div:first-child {
        width: 45%;
        height: 55px;
        margin-right: 15px;
    }
    .footer>div>div:last-child>div:last-child {
        width: 55%;
        height: 40px;
    }
    .footer>div>div:last-child>div:first-child img {
        width: 100%;
        height: 55px;
    }
    .footer>div>div:last-child>div:last-child img {
        width: 100%;
        height: 40px;
    }





    .move_btn .wish_list,
    .move_btn .speed_reservation,
    .move_btn .reserv_sheet {display: none;}

    .move_btn {
        position: fixed;
        bottom: 20px;
        right: 10px;
    }
    .move_btn .top_btn {
        width: 50px;
        height: 50px;
        border: 1px solid #ccc;
        border-radius: 25px;
        box-sizing: border-box;
        background-color: white;
        text-align: center;
        line-height: 50px;
        margin-bottom: 7px;
        display: none;
    }
    .move_btn .bottom_btn {
        width: 50px;
        height: 50px;
        border: 1px solid #ccc;
        border-radius: 25px;
        box-sizing: border-box;
        background-color: white;
        text-align: center;
        line-height: 50px;
        display: none;
    }
    .move_btn .speed_reservation {
        width: 50px;
        height: 50px;
        border-radius: 25px;
        box-sizing: border-box;
        background-color: #2e3192;
        color: white;
        text-align: center;
        padding-top: 7px;
        margin-bottom: 7px;
        font-size: 1.2rem;
        font-weight: lighter;
    }

}




